import React from 'react';

export default function Example() {
  return (
    <div className="bg-[#f4f6f9] p-4">
      {/* Header */}
      <div className="flex justify-between items-center bg-white p-2 border-b-[1px] border-[#d8dde6]">
        <div className="flex items-center">
          <div className="w-8 h-8 bg-[#0070d2] rounded-full flex items-center justify-center">
            <i className="fas fa-heart text-white"></i>
          </div>
          <span className="ml-2 text-[#333333] text-lg font-semibold">Makana Service Co...</span>
        </div>
        <div className="flex items-center space-x-2">
          <i className="fas fa-search text-[#333333]"></i>
          <i className="fas fa-bell text-[#333333]"></i>
          <i className="fas fa-question-circle text-[#333333]"></i>
          <i className="fas fa-user-circle text-[#333333]"></i>
        </div>
      </div>

      {/* Content */}
      <div className="flex">
        {/* Sidebar */}
        <div className="w-1/4 p-2">
          <div className="bg-white p-4 rounded-[8px] border-[1px] border-[#d8dde6] mb-4">
            {/* Case details here */}
          </div>
        </div>

        {/* Main Content */}
        <div className="w-2/4 p-2">
          <div className="bg-white p-4 rounded-[8px] border-[1px] border-[#d8dde6]">
            {/* Main content here */}
          </div>
        </div>

        {/* Knowledge Section */}
        <div className="w-1/4 p-2">
          <div className="bg-white p-4 rounded-[8px] border-[1px] border-[#d8dde6]">
            {/* Knowledge section here */}
          </div>
        </div>
      </div>
    </div>
  );
}
